// Default imports
import React, {Component} from 'react';
import Nav from "../navbar/navbar";
import Footer from "../../components/footer/footer";

// Custom imports
import './timeline.css';

class Timeline extends Component {
    renderEvents = () => {
        return <div>
            <div className="timeline">
                <div className="timeline-event">
                    <div className="card timeline-content">
                        <div className="card-content">
                            <span className="card-title">Muir College Boys High</span>
                            <p>Grade 12 (Matric)</p>
                            <div className='card-action'>
                                <span>2007 - 2019</span>
                            </div>
                        </div>
                    </div>
                    <div className="timeline-badge blue white-text"><i className="material-icons">school</i>
                    </div>
                </div>
            </div>
            <div className="timeline">
                <div className="timeline-event">
                    <div className="card timeline-content">
                        <div className="card-content">
                            <span className="card-title">Muir College Boys High</span>
                            <p>Grade 12 (Matric)</p>
                            <div className='card-action'>
                                <span>2007 - 2019</span>
                            </div>
                        </div>
                    </div>
                    <div className="timeline-badge blue white-text"><i className="material-icons">school</i>
                    </div>
                </div>
            </div>
        </div>
    };

    render() {
        return (
            // HTML here
            <div>
                <Nav/>
                <div className='container'>
                    <div className="section">
                        <div className='row'>
                            <h4>Progress...</h4>
                        </div>
                    </div>
                    <div className="divider">
                    </div>
                    {this.renderEvents()}
                </div>
                <Footer/>
            </div>
        )
    }
}

// Default export
export default Timeline;
